import React, { useState, useEffect , useSelector} from "react";
import { Redirect,Route } from 'react-router-dom';

const PrivateRoute = ({ Component, ...rest }) => (
    <Route {...rest} render={props => isAuthenticated() ? (
        <Component {...props} />
    ) : (
            <Redirect to={
                {
                    pathname: '/login',
                    state: {
                        form: props.location
                    }
                }} />
    )} />
)
  export default PrivateRoute
